  const style={
    backgroundImage:useSelector(state => state.loginInfoReducer.backgroundImage)
  };

  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element={<Login />}></Route>
      </Routes>
    </div>
  );
}

export default App;
